import React, { Component } from 'react'

class Paragraph extends Component {

  render() {
        return(
            <div>
                <p>
                Be kind to your {this.props.nounOne}-footed {this.props.pluralNoun}
                For a duck may be somebody`s {this.props.nounTwo},
                Be kind to your {this.props.pluralNoun} in {this.props.place}
                Where the weather is always {this.props.adjective}.

                You may think that this is the {this.props.nounThree},
                Well it is.
                </p>
            </div>
        )
    }
}

export default Paragraph
